import React from "react";
// import { Link } from "react-router-dom";
import Logo from "../../pages/Logo";
import {AppBar, Toolbar, Container, MenuItem, Link, Typography} from "@mui/material";

export default function Nav({ LinkArray }) {
  return (
    <AppBar position="static">
      <Container >
        <Toolbar disableGutters>
          <Logo />             
          {LinkArray.map((link) => (
            <MenuItem key={link.id}>
              <Link

                rel="noreferrer"
                href={link.path}
                color="inherit"
                underline="none"
              >
                <Typography marginLeft={3}>
                {link.label}
                </Typography>
                </Link>
            </MenuItem>
          ))}
        </Toolbar>
      </Container>
    </AppBar>
  );
}
